	add("tetris", "{\"term\":\"tetris\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Russian\"], \"text\":\"From Russian \u0027те́трис\u0027 () coined by the creator of the game, w:Alexey Pajitnov|Alexey Pajitnov, from the Greek numerical prefix \u0027тетра-\u0027 (tetra-) (as all of the game\u0027s pieces contain four segments) and \u0027те́ннис\u0027 (tennis) his favourite sport.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A puzzle video game in which falling tetrominoes must be manipulated to form complete lines, which are then cleared from the grid\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Matt O\u0027Keefe, \u0027You Think You Hear‎\u0027, page 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There is one nice moment in the music, but it\u0027s not the moment identified by the owner of the system, and one idiot goes so far as to gush, \u0026quot;This is better than \u0027\u0027Tetris\u0027\u0027!\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027: Jack Leonard, \u0027Bad Altitude\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"While I worked out a \u0027\u0027\u0027Tetris\u0027\u0027\u0027-like arrangement to get all of the leftovers into the oven, Phil\u0027s curiosity got the better of him\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Rachel DeWoskin, \u0027Foreign Babes in Beijing: Behind the Scenes of a New China‎\u0027, page 13\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"When people spoke to me, the sounds of their words were \u0027\u0027Tetris\u0027\u0027 shapes, falling. All I had to do was put each one in its bright, satisfying place\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, David Chinnery, Kurt William Keutzer, \u0027Closing the Power Gap between ASIC \u0026amp; custom\u0027, page 23\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027tetris\u0027\u0027 method does have some shortcomings, however. In placements produced by \u0027Feng Shui\u0027, the cells are closely packed\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, David Skibbins, \u0027The Star: A Tarot Card Mystery‎\u0027, page 14\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"From the kitchen the guy said, \u0026quot;I write science fiction. Or I\u0027m trying to write. I\u0027ve been staring at that screen for three days. You just interrupted a one-hour \u0027\u0027Tetris\u0027\u0027 marathon. I need to talk to a real human being.\u0026quot\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Daniel Radosh, \u0027Rapture Ready!: Adventures in the Parallel Universe of Christian Pop Culture\u0027‎, page 21\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"there were some other guys there who were into cosplay—that\u0027s costume play—and their thing was, they were dressed as \u0027\u0027Tetris\u0027\u0027 blocks\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"An endeavor involving rearranging things of different shape into a physical space\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Clare Sudbery, \u0027The dying of delight\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Then I looked at the furniture. It was all a bit unimaginative, so I rearranged everything at a jaunty angle. When I returned to the cellar I was still playing \u0027\u0027Tetris\u0027\u0027 with the cooker in my head\", \"priority\":16}]}, \"synonyms\":{}}");

